const NavBar = () => {
    return (
        <div className="text-white font-equinox-sans">
            <div className="max-w-auto mx-auto px-2 py-.5 flex items-center justify-between">
                <h1 className="text-lg font-bold ">WARIO</h1>
                <ul className="flex space-x-2 text-sm">
                    <li className="p-2">Home</li>
                    <li className="p-2">Mission</li>
                    <li className="p-2">Careers</li>
                    <li className="p-2">Contract</li>
                    <li className="p-2">Settings</li>
                </ul>
            </div>
            {/*RE */}

        </div>
    );
};

export default NavBar;
